#Requires -Version 2

$Hydrolysis = ""
$Tablecloth = ""
$Enlivening = ""
$Neutralize = ""
$Kilometers = ""
$Sanctioned = ""
$Empathized = ""
$Peremptory = ""
$Eradicates = ""
$Relabeling = ""
$Wallpapers = ""
$Neapolitan = ""
$Mosquitoes = ""
$Congealing = ""
$Silhouette = ""
$Gratefully = ""
$Harvesting = ""
$Fabulously = ""
$Refinishes = ""
$Nationwide = ""
$Chattering = ""
$Chihuahuas = ""
$Derailment = ""
$Nonplussed = ""

$Modules = @($Hydrolysis,$Tablecloth,$Enlivening,$Neutralize,$Kilometers,$Sanctioned,$Empathized,$Peremptory,$Eradicates,$Relabeling,$Wallpapers,$Neapolitan,$Mosquitoes,$Congealing,$Silhouette,$Gratefully,$Harvesting,$Fabulously,$Refinishes,$Nationwide,$Chattering,$Chihuahuas,$Derailment,$Nonplussed)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
